/* declare variables */
DECLARE @ObjectId         INT,
        @IndexId          SMALLINT,
        @ObjectName       VARCHAR(300),
        @IndexName        VARCHAR(128),
        @Chave            VARCHAR(899),
        @ColunasIncluidas VARCHAR(899),
        @IsUnique         BIT,
        @IgnoreDupKey     BIT,
        @IsprimaryKey     BIT,
        @FillFact         TINYINT,
        @AllowRowLocks    BIT,
        @AllowPageLocks   BIT,
        @TypeIndex        TINYINT;

DECLARE CreateIndex CURSOR FAST_FORWARD READ_ONLY FOR
SELECT IBD.ObjectId,
       IBD.IndexId,
       IBD.ObjectName,
       IBD.IndexName,
       IBD.Chave,
       IBD.ColunasIncluidas,
       IBD.IsUnique,
       IBD.IgnoreDupKey,
       IBD.IsprimaryKey,
       IBD.FillFact,
       IBD.AllowRowLocks,
       IBD.AllowPageLocks,
       IBD.TypeIndex
  FROM #IndicesBaseDados AS IBD
WHERE IBD.IsUnique = 0
AND IBD.ObjectName NOT LIKE '%Hangfire%'

OPEN CreateIndex;

FETCH NEXT FROM CreateIndex
 INTO @ObjectId,
      @IndexId,
      @ObjectName,
      @IndexName,
      @Chave,
      @ColunasIncluidas,
      @IsUnique,
      @IgnoreDupKey,
      @IsprimaryKey,
      @FillFact,
      @AllowRowLocks,
      @AllowPageLocks,
      @TypeIndex;


WHILE @@FETCH_STATUS = 0
    BEGIN
        IF(NOT EXISTS (
                          SELECT I.name,
                                 IC.*
                            FROM sys.indexes AS I
                                 JOIN sys.index_columns AS IC ON I.object_id = IC.object_id
                                                                 AND I.index_id = IC.index_id
                           WHERE
							   I.name = @IndexName
                      )
          )
            BEGIN

                --IsUnique						--IndexName								--ObjectName
                DECLARE @Comando NVARCHAR(4000);

				SET @FillFact = CASE WHEN @FillFact = 0 THEN 100
									 WHEN @FillFact = 10 THEN 90
									 WHEN @FillFact = 20 THEN 80
									 END

                SELECT @Comando = CONCAT('CREATE', SPACE(1), IIF(@IsUnique = 1, 'UNIQUE', ''), SPACE(1), 'NONCLUSTERED INDEX', SPACE(1), QUOTENAME(@IndexName), SPACE(2),
				 'ON', SPACE(2), @ObjectName, '(', @Chave, ') ', IIF(@ColunasIncluidas IS NOT NULL, ' INCLUDE(' + @ColunasIncluidas + ')', ''),
				  CONCAT('WITH(FILLFACTOR =', @FillFact,')'));
				 

				PRINT @Comando
                EXEC sys.sp_executesql @Comando;
            END;

        FETCH NEXT FROM CreateIndex
         INTO @ObjectId,
              @IndexId,
              @ObjectName,
              @IndexName,
              @Chave,
              @ColunasIncluidas,
              @IsUnique,
              @IgnoreDupKey,
              @IsprimaryKey,
              @FillFact,
              @AllowRowLocks,
              @AllowPageLocks,
              @TypeIndex;
    END;

CLOSE CreateIndex;
DEALLOCATE CreateIndex;
